import React from "react";
import logo from '../newtradr-logo.svg';

function AboutUs() {
    return (
        <>
        <div className='AboutUs'>
          <h2>About us: </h2>
          <h3>We are the first application to provide financial empowerment toward the community.</h3>
        </div>
        </>
      );
}

export default AboutUs;
